  [],\n\t\"revision_timestamp\": \"2016-07-15T04:25:31.577075\",\n\t\"name\": \"find-ryan-white-hiv-aids-medical-care-providers\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Find Ryan White HIV/AIDS Medical
  Care Providers tool is a locator tool designed to make data and information concerning
  HIV/AIDS resources more easily available to our users. It is intended to help people
  living with HIV/AIDS access the medical care they need but cannot afford. The user
  is able to search for Ryan White-funded medical care providers nearest a specific
  complete address, city and state, state and county, or ZIP code. The search results
  (medical care providers) are returned in groups of ten (numbered from one to ten)
  and are sorted by increasing distance away from the center of the search area (address
  or county). For each medical care provider entry in the list, the user is provided
  the Ryan White HIV/AIDS facility name, address, approximate distance from the center
  point of the search, telephone number, website address (where available) and a link
  for driving directions. The user has the option of viewing the search results either
  on a map or as text (default) and both views provide links to get more detailed
  information for each returned opportunity.</p>n\",\n\t\"license_title\": \"Other
